  false,\n\t\"url\": null,\n\t\"notes\": \"Slope is derived from gridded (5 m cell
  size) bathymetry from two sources: Multibeam bathymetry collected by Coral Reef
  Ecosystem Division aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; multibeam bathymetry
  collected aboard the US Naval Ship Sumner by the Naval Oceanographic Office, and
  lidar, also collected by the Naval Oceanographic Office. Cell values reflect the
  maximum rate of change (in degrees) in elevation between neighboring cells derived
  with the ArcGIS Spatial Analyst extension. This data set is for Saipan Islands,
  Commonwealth of the Northern Marianas (CNMI).\",\n\t\"license_title\": null,\n\t\"extras\":
